import React from "react";
import axios from "axios";
import { useState, useEffect } from "react";
import Locator from "./locator";
// import { Enfamils } from "./enfamils";

const Products = () => {
  const [locator, setLocator] = useState([]);
  const [query, setQuery] = useState("");

  const getLocator = () => {
    axios.get("http://localhost:8000/api/products").then((response) => {
      setLocator(response.data);
    });
  };
  useEffect(() => {
    getLocator();
  }, []);

  return (
    // <div className=" h-screen flex justify-center items-center bg-yellow-300">
    //   <h1 className="text-9xt uppercase font-black">Products</h1>
    <>
      <div className="flex content-center flex-wrap  h-10">
        <input
          type="text"
          placeholder="Search..."
          className="p-10px text-lg box-border content-center h-10 w-50 p-4 border-2 border-gray-400 bg-gray-200"
          onChange={(e) => setQuery(e.target.value)}
        />
        {Locator.map((locator) => {
          return <div>{locator.name}</div>;
        })}
      </div>

      {/* <ul className="p-0 list-none text-blue-600  ">
        {Locator.filter((locator) =>
          locator.name.toLowerCase().includes(query)
        ).map((locator) =>
          console.log(locator)(
            <li key={locator.id} className="mb:20px text-sm ">
              {locator.name}
            </li>
          )
        )}
      </ul> */}
    </>
  );
};

export default Products;
